import {
  SlTabPanel
} from "./chunk.RULXOBUX.js";

// src/react/tab-panel/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-tab-panel";
SlTabPanel.define("sl-tab-panel");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlTabPanel,
  react: React,
  events: {},
  displayName: "SlTabPanel"
});
var tab_panel_default = reactWrapper;

export {
  tab_panel_default
};
